from CAN.can_info import wacom_pages_urls, CAN_WACOM_ARICLES, xp_pen_pages_urls, CAN_XP_PEN_ARRICLESfrom CAN.can_model import CanStoredef start_can_wacom():    can = CanStore(wacom_pages_urls)    items = can.generate_info()    return can.compare_all_data(partner_list=items, articles_list=CAN_WACOM_ARICLES)def start_can_xp_pen():    can = CanStore(xp_pen_pages_urls)    items = can.generate_info()    return can.compare_all_data(partner_list=items, articles_list=CAN_XP_PEN_ARRICLES)